import React from "react";

const Pokemon = (props) => {
  const renderMembers = () => {
    return props.element.member.map((member) => {
      return <li>{member}</li>;
    });
  };
  return (
    <article>
      <i className={props.icon}> </i>
      <h2>{props.name}</h2>
    </article>
  );
};

export default Pokemon;
